/* @flow */
/* eslint-disable import/no-commonjs */

module.exports = {
  get TabViewAnimated() {
    return require('react-native-tab-view/src/TabViewAnimated').default;
  },
  get TabViewPagerPan() {
    return require('react-native-tab-view/src/TabViewPagerPan').default;
  },
  get TabViewPagerScroll() {
    return require('react-native-tab-view/src/TabViewPagerScroll').default;
  },
  get TabViewPagerAndroid() {
    return require('react-native-tab-view/src/TabViewPagerAndroid').default;
  },
  get TabViewPagerExperimental() {
    return require('react-native-tab-view/src/TabViewPagerExperimental').default;
  },
  get TabBar() {
    return require('react-native-tab-view/src/TabBar').default;
  },
  get SceneMap() {
    return require('react-native-tab-view/src/SceneMap').default;
  },
};
